import React from 'react';

const Home=()=>{
    return(
      <div className='home'>
        <div className='card home-card'>
            <h5>Home</h5>
            <div className='card-image'>
                <img src="https://images.unsplash.com/photo-1503023345310-bd7c1de61c7d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MzV8fHBlcnNvbnxlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60" alt="random" /> 
             
            </div>
            <div className='card-con'></div>
        </div>
      </div>
    )
}
export default Home;
